// CartPage.tsx

import React, { useState } from 'react';
import './CartPage.scss';

const CartPage: React.FC = () => {
    const [quantity, setQuantity] = useState(1);
    const [shippingOption, setShippingOption] = useState('Fixed');

    const itemPrice = 45.00;
    const shippingCost = shippingOption === 'Fixed' ? 5.00 : 15.00;
    const subtotal = itemPrice * quantity;
    const orderTotal = subtotal + shippingCost;

    const handleQuantityChange = (e: React.ChangeEvent<HTMLInputElement>) => {
        setQuantity(parseInt(e.target.value) || 1);
    };

    const handleShippingChange = (e: React.ChangeEvent<HTMLInputElement>) => {
        setShippingOption(e.target.value);
    };

    return (
        <div className="cart-page">
            <div className="cart-header">
                <h2>Shopping Cart</h2>
            </div>
            <div className="cart-content">
                <div className="cart-item">
                    <img src="/path/to/gold-image.png" alt="Gold" className="item-image" />
                    <div className="item-details">
                        <p className="item-name">GOLD</p>
                        <p className="item-size">Size: 2g</p>
                        <div className="item-price-qty">
                            <p className="item-price">${itemPrice.toFixed(2)}</p>
                            <input
                                type="number"
                                value={quantity}
                                onChange={handleQuantityChange}
                                className="quantity-input"
                                min="1"
                            />
                            <p className="item-subtotal">${subtotal.toFixed(2)}</p>
                        </div>
                    </div>
                </div>

                <div className="cart-summary">
                    <h3>Summary</h3>
                    <div className="shipping">
                        <label>Estimate Shipping and Tax</label>
                        <select>
                            <option>United States</option>
                            {/* Add more countries as needed */}
                        </select>
                        <select>
                            <option>Please select a region, state or province</option>
                            {/* Add states as needed */}
                        </select>
                        <input type="text" placeholder="Zip/Postal Code" />
                    </div>

                    <div className="shipping-options">
                        <div>
                            <input
                                type="radio"
                                id="fixed"
                                name="shipping"
                                value="Fixed"
                                checked={shippingOption === 'Fixed'}
                                onChange={handleShippingChange}
                            />
                            <label htmlFor="fixed">Fixed $5.00</label>
                        </div>
                        <div>
                            <input
                                type="radio"
                                id="table"
                                name="shipping"
                                value="Table"
                                checked={shippingOption === 'Table'}
                                onChange={handleShippingChange}
                            />
                            <label htmlFor="table">Table Rate $15.00</label>
                        </div>
                    </div>

                    <div className="totals">
                        <p>Subtotal: ${subtotal.toFixed(2)}</p>
                        <p>Tax: $0.00</p>
                        <h4>Order Total: ${orderTotal.toFixed(2)}</h4>
                    </div>

                    <button className="checkout-button">Proceed to Checkout</button>
                </div>
            </div>
        </div>
    );
};

export default CartPage;
